webpackJsonp([44246160339990],{293:function(A,e){A.exports={data:{post:{title:"Edition 11 (2/14/18)",content:'<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Friends,</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">First and foremost, happy Valentine&rsquo;s Day! If you&rsquo;re spending time reading this today, you may be single, or you just really love us. If the latter is the case, good news, here&rsquo;s our </span><a href="https://siyucapital.com/"><span style="color:#0000ff">website</span></a><span style="color:#000000">. It isn&rsquo;t much so far, but you can easily refer friends to drop in with their email and subscribe, and you can look at all of our past content as well. If the former is the case, we have plenty of </span><em><span style="color:#000000">hot</span></em><span style="color:#000000"> tidbits you can lift from this brief for conversation at your local watering hole. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Another side note: we want your opinions. Please send us feedback on content, format, topics you want us to cover, finance memes (especially these), etc.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">At any rate, the markets don&rsquo;t care about your relationship status, or about us for that matter &mdash; the show goes on!</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">We&rsquo;ll get started with some macroeconomics talk, then we will discuss goings-on in the news, and lastly we&rsquo;ll dive into the options ouroboros. Strap in and let&rsquo;s ride.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Macro Corner</span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The rally that capped off last week&rsquo;s trading week has calmed down as the market trades within a narrower range this week and the VIX tapers off again as we still digest the past few weeks&rsquo; wild ride. It&rsquo;s difficult to say whether last week&rsquo;s late uptick and this week&rsquo;s consistency (read: not falling more) is legit or is indicative of the &ldquo;</span><a href="https://www.investopedia.com/terms/d/deadcatbounce.asp"><span style="color:#1155cc">dead cat bounce</span></a><span style="color:#000000">.&rdquo; History suggests that the downward trends continue after short recoveries. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">2008 was a perfect example of this in action. There were several short-lived recoveries (cat bounces) throughout the year, with a notable one being the market uptick that followed the initial market decline after the House&rsquo;s rejection of </span><a href="https://en.wikipedia.org/wiki/Emergency_Economic_Stabilization_Act_of_2008#First_House_vote,_September_29"><span style="color:#1155cc">TARP</span></a><span style="color:#000000"> (a subset of the federal government&rsquo;s bailout package). As you can see, the rally following that declined eventually gave in to greater pressures, and the market continued its slide.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img src="data:image/png;base64," style="height:312px; width:403px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">We could see a similar pattern (although less extreme...hopefully) form over the next few days. As markets climb today (2/14), watch 2720 as a potential resistance level in the S&amp;P 500 (2690 as of this writing) for the rest of the week.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The same issues that spooked the market last week still linger &mdash; e.g., rising interest rates, rising wages, rising inflation, rising yields, and the prospect of a continuously and massively rising deficit (which we&rsquo;ll address a few lines down). </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">On a similar note, the below chart shows the spread between the 5-year Treasury Bill and implied inflation rates for the same timeframe. Notice that the spread has grown since 2012, ultimately turning positive. Today we have the largest spread in the last 9 years. In layman&rsquo;s terms, this means that expected inflation predictions are lagging U.S. government bond yields. Unless bond yields retreat again (which seems unlikely given their current trajectory), inflation expectations will need to be adjusted higher in the immediate future.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img alt="inflation gap" src="data:image/png;base64," style="height:342px; width:484px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Quick Note on the Federal Budget</span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">We&rsquo;ve been planning a detailed discussion of the national debt/deficit, and what the hell it actually means for the government, the world, and for me and you. We want to cover the ramifications and what-ifs of unmitigated debt (i.e. &ldquo;What if China replaces the U.S. as the world&rsquo;s preferred issuer of debt over the next 10 years, what if other states go dick up like Illinois and devalue to junk grade&rdquo;, etc.). Unless we get more market turbulence that needs addressing, this will be a major topic next week.&nbsp; </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">It&rsquo;s worth mentioning that the proposed Trump budget plan will further the country&rsquo;s deficit. Per the New York Times, the plan increases the deficit by $1 trillion &mdash; yes trillion with a T not B &mdash; over the coming decade. (The size of this increase is predicated in part on recent tax cuts and proposed spending programs, i.e., the wall and military spending). </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The most intriguing part of the plan is the government&rsquo;s underlying assumptions on economic growth &mdash; the plan envisions an </span><a href="https://www.wsj.com/articles/white-house-budget-to-project-3-growth-1518211267"><span style="color:#1155cc">annual 3% GDP growth rate</span></a><span style="color:#000000"> over the coming decade. For perspective, the economy grew at a 2.5% rate in 2017. For context, the US </span><a href="https://tradingeconomics.com/united-states/gdp-growth-annual"><span style="color:#1155cc">averaged</span></a><span style="color:#000000"> a 3.19% rate from 1948 until 2017, with a decreasing trend over time. Developed countries grow less and less over time, hence the slight downward trend below:</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img src="data:image/png;base64," style="height:247px; width:535px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Back to the Trump plan. Do we think the Trump 3% target is ambitious? Yes. Considering our likely later-stage place in one of the longest bull markets ever, it seems tough to believe an increasingly aging country can keep it up. Especially at a consistent clip for an entire decade. If growth does slump then the plan will lead to deficit increases far higher than current projections. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Investors too have been mulling this over. These fiscal uncertainties will likely wax as a domestic and global risk factor in equity and capital markets in the coming months and years.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Speaking of Recent Volatility!</span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Volatile market conditions (as we had the pleasure of observing last week) are particularly interesting because they often result in absurd, gargantuan trades that we then have the pleasure of analyzing and presenting to you. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">For instance, 75,000 put options were bought on $SHY on Thursday (2/8). $SHY is an index from Barclays that tracks 1-3 year US treasuries. Is a total of 75,000 put options on this index a lot? </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Wait, slow down. What is a put option? We have often touched on options already, but this is a good time for some disambiguation. There are two <em>basic</em></span><span style="color:#000000"> or &ldquo;vanilla&rdquo; types of options: calls and puts. A put option gives its owner the right, </span><em><span style="color:#000000">but not the obligation</span></em><span style="color:#000000"> (hence option) to sell 100 shares of the underlying asset (in this case $SHY). Call options, conversely, give the owner the right, but not the obligation,</span><em> </em><span style="color:#000000">to buy the shares. Let&rsquo;s have an example:</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">If equity (a stock) is currently trading at $100, a speculator who believes the equity to be overvalued (expensive) could buy a put option with a <em>strike</em></span> <em><span style="color:#000000">price of </span></em><span style="color:#000000">$100. Strike price simply specifies the price the option contract will let its holder sell the underlying shares at. This put option would cost some amount of money to compensate the seller of the option (who assumes the opposite side of the trade of the buyer) for the risk that the equity price indeed moves down as the buyer hopes it will. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">If the equity trades at $80 two weeks later, the intrinsic value of the put option would be $100-$80 = $20 * 100 = $2,000, per the option owner&rsquo;s right to sell 100 shares of the underlying at the $100 strike price rather than the new, lower market price. The $2,000 gain the buyer of the put option enjoyed would represent a loss to the seller of the option. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">This zero-sum relationship is true of options trading in general. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Now, back to this 75,000 put option trade. Considering that the average total daily option volume on $SHY prior to Thursday was 18 contracts, 75,000 represents 4169 times the daily average option volume. Here&rsquo;s how it looked on an unusual option volume screener: </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000"><img src="data:image/png;base64," style="height:39px; width:669px" /></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">What does this mean? Presumably some portfolio manager wanted to hedge against losses in approximately 7.5 million shares of $SHY, or to hedge an equivalent Treasury portfolio against further losses. We say <em>hedge </em></span><span style="color:#000000">because it is unlikely that this was a speculative investment. It&rsquo;s more likely that these puts were bought to protect against further downside, as they will gain value thus offsetting losses if the value of the underlying shares of $SHY fall. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">The quick math on the likely portfolio size comes from the aforementioned fact that a standardized put option represents the right to sell 100 contracts of the underlying. 75,000 puts * 100 underlying shares each = a means of hedging 7.5MM shares of $SHY. With a price per share of approximately ~ $30, a hedge on 7.5MM shares of $SHY is a hedge on north of $210 million dollars of treasuries. Clearly there is significant concern about further weakness of demand in coming Treasury auctions and about </span><a href="https://www.investopedia.com/terms/s/systematicrisk.asp"><span style="color:#0000ff">systematic risk</span></a><span style="color:#000000"> in the bond market overall. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">This above case represents one of the most common uses of options, namely in <em>risk shifting</em></span><span style="color:#000000">. This encompasses the hedging we discussed above, but extends to include any method by which the distribution of possible outcomes for a portfolio is changed. The CFA institute provides a few examples: </span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in"><span style="color:#000000">&ldquo;A firm with a large position in a specific stock can buy put options that provide a minimum sale price for the securities&hellip; (in this case providing a floor value for the securities). On the other hand, a firm could sell call options on a specific stock&hellip; giving up some of the upside potential of the stock but decreasing its downside risk by the amount of the premiums received from the sale of the call options.&rdquo;</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><u><span style="color:#000000">Options: A Deeper Dive </span></u></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><a href="https://en.wikipedia.org/wiki/Greeks_(finance)#Lambda"><span style="color:#0000ff">The </span></a><a href="https://en.wikipedia.org/wiki/Greeks_(finance)#Lambda"><em><span style="color:#0000ff">Greeks</span></em></a><span style="color:#000000"> are a key topic in mathematical finance, and represent the sensitivity of the price of derivatives to changes in the underlying assets or instruments from which the derivatives </span><em><span style="color:#000000">derive</span></em><span style="color:#000000"> their value. If you remember any of your physics (don&rsquo;t worry, we don&rsquo;t really either, but F = ma, right?), think of the Greeks in a similar fashion to how velocity is the derivative of position. That is to say, velocity is the rate of change of position. Comparably, </span><em><span style="color:#000000">Delta</span></em><span style="color:#000000"> (one of the Greeks) is similar to a derivative of price, where it references the rate of change of the price of a derivative in response to a change of price in the underlying asset.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Let&rsquo;s make this a little more practical. Below you will see a table of option prices and statistics. The center or <em>spine</em></span><span style="color:#000000"> of the table represents strike prices in $AMZN (Amazon stock). Recall that these strike prices specify at which prices options will allow their owners to buy and sell shares in the underlying. At the time of this screenshot, $AMZN was trading at $1388.375, as you can see under </span><em><span style="color:#000000">Last Price</span></em><span style="color:#000000">. Call option prices are to the right of the spine, with put option prices to the left. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><img src="data:image/png;base64," /></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">To tie this back to Delta, you can see the delta columns (white numbers in the columns labeled with &quot;Delta&quot; above). Let&rsquo;s look at the calls and puts at the 1390 strike price. These options are very close to being <em>at-the-money (ATM)</em></span><span style="color:#000000">, meaning the strike price of the options is close to the actual current price of the underlying. Both the calls and puts here have a delta of 0.5. </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">What does a delta of 0.5 mean? It means that for every $1 change in the underlying, the value of the calls and puts will change by $0.5, with the direction of the change depending on the direction of the move in the underlying. ATM options will typically have deltas of approximately 0.5.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">For options that are very deeply <em>in-the-money</em></span><span style="color:#000000"> (consider a call option with a strike price of $20 for a stock that is at $80), the delta will be very close to 1, as the option begins to move nearly in lock-step with the underlying equity. Options that are far </span><em><span style="color:#000000">out-of-the </span></em><span style="color:#000000">money have low deltas; when option strike prices are distant from current underlying prices, they won&rsquo;t start increasingly in value significantly until the price of the underlying is closer to the strike price.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Delta can in theory never exceed 1, as &ldquo;an option can never gain or lose value more quickly than the underlying.&rdquo;1</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><em><span style="color:#000000">Delta + the other Greeks:</span></em></p>\r\n\r\n<ul>\r\n\t<li><strong>Delta:</strong> The sensitivity of the option&#39;s value to the price of the underlying asset</li>\r\n\t<li><span style="color:#000000"><strong>Gamma:</strong> The sensitivity of delta to changes in the price of the underlying (Think of this as the derivative of delta)</span>\r\n\t<ul style="list-style-type:circle">\r\n\t\t<li><span style="color:#000000">Here&rsquo;s where Nick gets really excited; the delineation of delta above didn&rsquo;t touch on the fact that delta itself is constantly changing as price get closer to or further from option strike prices. Gamma measures this rate of change in delta. </span>\r\n\t\t<ul style="list-style-type:disc">\r\n\t\t\t<li><span style="color:#000000">To extend our physics analogy from earlier, insofar as acceleration is the derivative of velocity, which is the derivative of position, gamma is the derivative of delta, which is the derivative of underlying price (ish). </span></li>\r\n\t\t</ul>\r\n\t\t</li>\r\n\t\t<li><span style="color:#000000">&ldquo;Gamma is usually expressed in deltas gained or lost per one point change in the underlying&rdquo;1</span></li>\r\n\t</ul>\r\n\t</li>\r\n\t<li><span style="color:#000000"><strong>Vega:</strong> The sensitivity of the option&#39;s value to the volatility of the underlying asset</span></li>\r\n\t<li><span style="color:#000000"><strong>Theta:</strong> The sensitivity of the option&#39;s value to the passage of time (options are always getting closer to their expiration dates)</span></li>\r\n\t<li><span style="color:#000000"><strong>Rho:</strong> The sensitivity of the option&#39;s value to changes in the risk-free-interest rate</span>\r\n\t<ul style="list-style-type:circle">\r\n\t\t<li><span style="color:#000000">This is the least influential of all of the Greeks, and is usually not belabored in making option trading decisions</span></li>\r\n\t</ul>\r\n\t</li>\r\n</ul>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">This is only the beginning of a longer deliberation we will have on options and derivatives. Next week we&rsquo;ll deliver more thoughts on the deficit as promised, and will continue this deep-dive into the options universe.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Thanks for tuning in, folks! We hope you stuck around with us and have enjoyed today&rsquo;s read. Now go out there, take an eye off the VIX for a minute, and enjoy Valentine&rsquo;s day with the person or people you care about.</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Na Zdrav&iacute;,</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Mark Grace</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">Nick van Osdol</span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in"><span style="color:#000000">1 &ldquo;Option Pricing and Volatility&rdquo; &ndash; Sheldon Natenberg (1994)</span></p>',
updated:"2018-02-14T22:10:45.363053Z",fields:{slug:"Edition-11",date:"(2/14/18)"}}},pathContext:{slug:"Edition-11"}}}});
